import { BrowserRouter as Router, Route } from 'react-router-dom';
import './App.css';
import Home from './pages/Home';

function App() {



  return (
    <html lang="en">
      <body >
        <Router>
          <Route path='/' Component={Home} />
        </Router>
      </body>
    </html>
  );
}

export default App;
